import React from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import {Home} from './pages/Home'

function App() {
  return (
    <Router>
    <div className="container pt-4">
      <Routes>
        <Route path='/' exact component={Home} />
      </Routes>
    </div>
    </Router>
  );
}

export default App;
